import logo from './logo.svg';
import './App.css';
import styled from "styled-components";
import Neo4j from './Neo4j';

var Neo4jInstance = new Neo4j();



const Button = styled.button`
  background-color: black;
  color: white;
  font-size: calc(10px + 2vmin);
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
  margin: 20px;
`;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> SQL<br></br>
          <Button onClick={new Neo4jInstance().getInfluenceurProducts()}>Requête 1</Button>
          <Button>Requête 2</Button>
          <Button >Requête 3</Button>
          
        </p>
        <br></br>
        <br></br>
        <p> NoSQL<br></br> 
          <Button>Requête 1</Button>
          <Button >Requête 2</Button>
          <Button>Requête 3</Button>
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
         
        </a>

      </header>
    </div>
  );
}

export default App;
